import React, { useState } from 'react';

import { BsFillPeopleFill } from 'react-icons/bs';
import { MdSecurity } from 'react-icons/md'; 

import {Link} from 'react-router-dom';

import './cadastro.css';

function Login(){
    const [nome, setNome] = useState("")
    const [senha, setSenha] = useState("")
    const [show, setShow] = useState(false)
    const handleClick = (e) => {
        e.preventDefault()
        setShow(!show);
    }
    return(
        <div className="login">
            <form>
                <div className="login-right">
                    <h1> Cadastro </h1>
                    <br/>
                    <div className="login-nome">
                        <BsFillPeopleFill />
                        <input 
                            required
                            type="text" 
                            placeholder="Digite seu Nome"
                            value={nome}
                            onChange={e => setNome(e.target.value)}
                        />
                    </div>

                    <div className="login-senha">
                        <MdSecurity />
                        <input 
                            required
                            type={show ? "text" : "password"} 
                            placeholder="Digite sua Senha"
                            value={senha}
                            onChange={e => setSenha(e.target.value)}
                        /> 
                        <div className="cadastro-eye">
                            {show ? (
                                <HiEye 
                                    onClick={handleClick}
                                />
                            ) : (
                                    <HiEyeOff 
                                        onClick={handleClick}
                                    />
                                )}
                        </div>
                    </div>

                    <h4>Não possui conta?</h4>

                    <div className="login-button">
                        <Link to='/cadastro'>
                            <button className="login-cadastrese" type='submit'>
                                Cadastre-se
                            </button>
                        </Link>
                    </div>
                </div>
            </form>
            <div className="login-logo">
                <img
                    src="https://api.freelogodesign.org/files/4af636d8356b42dcbcdd9484bc6a65dd/thumb/logo_200x200.png?v=637657716850000000" 
                    alt="Agendei Logo"
                />
            </div>
        </div>    
    )
}

export default Login
